function Navi(props)
{
    const handleLogout = history => () => {
        const {history} =this.props;
        store.remove('loggedIn');
        history.push('/log');
    };

        return(
            <div>
                <Navbar className="fixed-top" dark expand="md">
                    <div className="container-fluid">
                        <NavbarToggler />
                        <NavbarBrand className="mr-auto" href="/"><h3>Wallet as a Service</h3></NavbarBrand>

                            <Nav navbar className="ml-auto">
                                <NavItem>
                                    <NavLink className="nav-link"  to='/home'><span className="fa fa-home fa-lg"></span> Home</NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink className="nav-link" to='/home'><span className="fa fa-user fa-lg"></span>User</NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink  className="nav-link" to='/home' ><button onClick={this.handleLogout(history)}> <span className="fa fa-sign-out fa-lg"></span> Log Out</button></NavLink>
                                </NavItem>
                            </Nav>
                    </div>
                </Navbar>

            </div>
        );

}

